import { useEffect, useState } from "react";
import Table from "react-bootstrap/Table";
import ReactPaginate from "react-paginate";
import { fetchAllXX } from "../services/xuatXuSevice";
import Button from "react-bootstrap/Button";
const TableXuatXu = (props) => {
  const [listXuatXu, setListXuatXu] = useState([]);
  // const [totalXx, setTotalXx] = useState(0);
  const [totalPages, setTotalPages] = useState(0);

  useEffect(() => {
    getXanXuat(0);
  }, []);

  const getXanXuat = async (page) => {
    let res = await fetchAllXX(page);
    console.log("Data", res);
    if (res && res.content) {
      setListXuatXu(res.content);
      console.log("Data", res);
      // setTotalXx(res.totalElements);
      setTotalPages(res.totalPages);
    }
  };
  const handlePageClick = (event) => {
    getXanXuat(+event.selected);
  };

  console.log(listXuatXu);
  return (
    <>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Ma Xuat Xu</th>
            <th>Ten Nuoc</th>
            <th>Tinh Trang</th>
            <th>Function</th>
          </tr>
        </thead>
        <tbody>
          {listXuatXu &&
            listXuatXu.length > 0 &&
            listXuatXu.map((item, index) => {
              return (
                <tr key={`xuatXu-${index}`}>
                  <td>{item.maXx}</td>
                  <td>{item.tenNuoc}</td>
                  <td>{item.tinhTrang === 0 ? "Con" : "Het"}</td>
                  <td>
                    <Button variant="outline-success">Success</Button>{" "}
                    <Button variant="outline-warning">Warning</Button>{" "}
                  </td>
                </tr>
              );
            })}
        </tbody>
      </Table>
      <ReactPaginate
        breakLabel="..."
        nextLabel="next >"
        onPageChange={handlePageClick}
        pageRangeDisplayed={5}
        pageCount={totalPages}
        previousLabel="< previous"
        renderOnZeroPageCount={null}
        //Class foem
        pageClassName="page-item"
        pageLinkClassName="page-link"
        previousClassName="page-item"
        previousLinkClassName="page-link"
        nextClassName="page-item"
        nextLinkClassName="page-link"
        breakClassName="page-item"
        breakLinkClassName="page-link"
        containerClassName="pagination"
        activeClassName="active"
      />
    </>
  );
};
export default TableXuatXu;
